import React from 'react';
import drago from '../src/Images/drag.jpg';
import Common  from './Common';
const Home = ()=>{
    return(
        
      <Common
      name="Grow your business with "
      img = {drago}
      visit = "/service"
      btnname="Get Started"
      />

    )
}

export default Home;
